import {add,sub,mul,div} from './Home';

function App() {
    return(
     <ul>
        <li>{add(22,2)}</li>
        <li>{sub(22,2)}</li>
        <li>{mul(22,2)}</li>
        <li>{div(22,3)}</li>
     </ul>
    );
}

export default App;
